text_content:
some integrations are only whitelisted for datos ips, to be sure it works it would be nice if the user can select "datos network" instead of entering an ssh tunnel settings

the ssh tunnel settings should look like this:
        "ssh_tunnel": {
            "enabled": true,
            "predefined": "datos"
        }

